import React, { useParams, useState } from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';

const mystyle = {
    background: 'lightblue',
    width: '500px',
    height: '500px',
    margin: '100px',
    padding: '10px',
    textAlign: 'center',
    borderRadius: '20px',
    boxShadow: '5px 5px 5px gray'
}

const UpdateOrder = () => {
    const{id} = useParams();
    const history = useNavigate();

    const [order, setOrder] = useState({
        displayOrderId: "",
        awbNo: "",
        logisticName: ""
    })
    const { displayOrderId, awbNo, logisticName } = order;

    const onInputChange = (e) => {
        setOrder({ ...order, [e.target.name]: e.target.value });
    };

    const sumitHandler = async (e) => {
        e.preventDefault();
        await axios.post("http://localhost:8080/getcustomerorders", order);
        history("/");
    }
    const loadUsers = async () => {
        const result = await axios.get("http://localhost:8080/getcustomerorders");
        setOrders(result.data.reverse());
      };


    return (
        <div style={mystyle}>
            <div className="d-flex justify-content-between m-3">
                <h2>UPDATE ORDER </h2>
                <Link to="/">
                    <Button variant="primary">Show Order</Button>
                </Link>
            </div>
            <Form onSubmit={(e) => sumitHandler(e)}>
                <Form.Group className="mb-3" >
                    <Form.Label>displayOrderId</Form.Label>
                    <Form.Control type="text" placeholder="10-digit" name="displayOrderId" value={displayOrderId} onChange={(e) => onInputChange(e)} />
                </Form.Group>
                <Form.Group className="mb-3" >
                    <Form.Label>awbNo</Form.Label>
                    <Form.Control type="text" name="awbNo" value={awbNo} onChange={(e) => onInputChange(e)} />
                </Form.Group>
                <Form.Group className="mb-3" >
                    <Form.Label>logisticName</Form.Label>
                    <Form.Control type="text" name="logisticName" value={logisticName} onChange={(e) => onInputChange(e)} />
                </Form.Group>
                <label className="col-md-3 control-label"></label>
                <div className="col-md-10">
                    <Button type="submit"  >Send </Button>
                    <Link to="/readorders">
                        <Button variant="primary">cancel</Button>
                    </Link>
                </div>

            </Form>
        </div >
    );

}

export default UpdateOrder
